import React from "react";

class signin extends React.Component {
  render() {
    return (
      <div>
        <small>
          You are running this application in{" "}
          <b>{process.env.NODE_ENV}</b> mode.
        </small>
        <form>
          <input
            type="hidden"
            defaultValue={
              process.env.REACT_APP_COCKTAILS_API_KEY
            }
          />
        </form>
      </div>
    );
  }
}
export default signin;
